import React from 'react';
import logo from './logo.svg';
import './App.css';

class Clock extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      carName: ['car1', 'car2', 'car3']
    };
  }

  render() {
    return (
      <div>
        <h1>Привет, мир!</h1>
        <div>{this.state.carName}</div>
        <div>
        {this.state.carName.map((car) => car )} 
        </div>
      </div>
    );
  }
}








export default Clock;
